import HeaderImg from "../../Components/images/header.jpg";
import "./header.css";
const Header = () =>{

    return (
        <>
            {/* Header */}
            <div className="header">
                <div className="img">
                    <div>
                        <img src={HeaderImg} alt=""/>
                    </div>
                    <div className="Overlay"></div>
                </div>
                <div className="Content">
                <h6>Cars king</h6> 
                <p>tralala</p>
                <button className="btn">Read More</button>
                </div>
            
            </div>
            }
        </>
    )
}

export default Header;
